#include <ESP8266WiFi.h>
#include <PubSubClient.h>

// Wifi Credentials
const char* ssid = YourSSID
const char* password = ""YourPassword""	

// MQTT Credentials
const char* mqtt_server = ""YourMQTTServer""	
const char* mqtt_user = ""YourMQTTUser""	
const char* mqtt_password = ""YourMQTTPassword""	

// Pins
const int flame_sensor_pin = D1	
const int pir_sensor_pin = D2	

// Variables
int flame_sensor_value = 0	
int pir_sensor_value = 0	

// MQTT
WiFiClient espClient	
PubSubClient client(espClient)	

void setup_wifi() {
  delay(10)	
  Serial.println()	
  Serial.print(""Connecting to "")	
  Serial.println(ssid)	

  WiFi.begin(ssid, password)	

  while (WiFi.status() != WL_CONNECTED) {
    delay(500)	
    Serial.print(""."")	
  }

  Serial.println("""")	
  Serial.println(""WiFi connected"")	
  Serial.println(""IP address: "")	
  Serial.println(WiFi.localIP())	
}

void callback(char* topic, byte* payload, unsigned int length) {
  Serial.print(""Message arrived ["")	
  Serial.print(topic)	
  Serial.print(""] "")	
  for (int i = 0	 i < length	 i++) {
    Serial.print((char)payload[i])	
  }
  Serial.println()	
}

void reconnect() {
  while (!client.connected()) {
    Serial.print(""Attempting MQTT connection..."")	
    if (client.connect(""ESP8266Client"", mqtt_user, mqtt_password)) {
      Serial.println(""connected"")	
    } else {
      Serial.print(""failed, rc="")	
      Serial.print(client.state())	
      Serial.println("" try again in 5 seconds"")	
      delay(5000)	
    }
  }
}

void setup() {
  Serial.begin(115200)	
  setup_wifi()	
  client.setServer(mqtt_server, 1883)	
  client.setCallback(callback)	
  pinMode(flame_sensor_pin, INPUT)	
  pinMode(pir_sensor_pin, INPUT)	
}

void loop() {
  if (!client.connected()) {
    reconnect()	
  }
  client.loop()	

  flame_sensor_value = digitalRead(flame_sensor_pin)	
  pir_sensor_value = digitalRead(pir_sensor_pin)	

  Serial.print(""Flame Sensor Value: "")	
  Serial.println(flame_sensor_value)	
  Serial.print(""PIR Sensor Value: "")	
  Serial.println(pir_sensor_value)	

  client.publish(""sensor/flame"", String(flame_sensor_value).c_str())	
  client.publish(""sensor/pir"", String(pir_sensor_value).c_str())	

  delay(1000)	
}

